def bubblesort(list :list) -> list:
    for i in range(len((list))):
       for i in range(len(list) - 1):
           if list[i] > list[i+1]:
               list[i], list[i+1] = list[i + 1], list[i]
               lenght = len(list)
               i = lenght - 1 
    return list

def binary_search(search) -> int:
    low = 0
    high = len(list) - 1
    while low <= high:
        mid = (high + low) // 2
        if list[mid]['surname'] > search:
            high = mid - 1 
        elif list[mid]['surname'] < search:
            low = mid + 1
        else:
            return mid
    


def find_number(surname) -> str:
    index = binary_search(surname)
